import React, { Component } from 'react'
import { Fragment } from 'react/cjs/react.production.min';

export default class VehicleRadio extends Component {
  render() {
    return (
      <Fragment>
          <input type="radio" id="vehicles-1" name={'vehicles_group_'+this.props.id} value="vehicles 1" />
          <label htmlFor="vehicles-1">vehicles 1</label>
      </Fragment>
    )
  }
}
